class Parser:
    def __init__(self, tokens):
        self.tokens = tokens
        self.id_token = 0
        self.actual_token = self.tokens[self.id_token]
        self.last_token = ''

    def advance(self):
        self.id_token += 1
        if self.id_token < len(self.tokens):
            self.actual_token = self.tokens[self.id_token]
            self.last_token = self.tokens[self.id_token - 1]

    def expect(self, item, arg=None):
        og = self.id_token
        possible = False
        if item != None:
            try:
                if arg == None:
                    ans = item()
                else:
                    ans = item(arg)
                if type(ans) == bool:
                    possible = ans
                else:
                    possible = True
            except:
                possible = False
        self.id_token = og
        self.actual_token = self.tokens[self.id_token]
        self.last_token = self.tokens[self.id_token - 1]
        return possible

    def read(self, item, type=False):
        if type:
            if self.actual_token.type == item:
                self.advance()
                return True
            else:
                return False
        else:
            if self.actual_token.value == item:
                self.advance()
                return True
            else:
                return False
    value, result, value1, value2 = 0, 0, 0, 0

    def Expr(self):
        while self.expect(self.Stat,):
            self.Stat()
            self.read(";")
            break
        self.read(".")

    def Stat(self):
        value = 0
        value = self.Expression(value)
        print(str(value))

    def Expression(self, result):
        result1, result2 = 0, 0
        result1 = self.Term(result1)
        while self.expect(self.read, "+") or self.expect(self.read, "-"):
            if self.expect(self.read, "+"):
                self.read("+")
                result2 = self.Term(result2)
                result1 += result2
            elif self.expect(self.read, "-"):
                self.read("-")
                result2 = self.Term(result2)
                result1 -= result2
        result = result1
        return result


    def Term(self, result):
        result1, result2 = 0, 0
        result1 = self.Factor(result1)
        while self.expect(self.read, "*") or self.expect(self.read, "/"):
            if self.expect(self.read, "*"):
                self.read("*")
                result2 = self.Factor(result2)
                result1 *= result2
            elif self.expect(self.read, "/"):
                self.read("/")
                result2 = self.Factor(result2)
                result1 /= result2
        result = result1
        return result


    def Factor(self, result):
        signo = 1
        if self.expect(self.read, '-'):
            self.read("-")
            signo = -1
        if self.expect(self.Number, result):
            result = self.Number(result)

        elif self.expect(self.read, "("):
            self.read("(")
            result = self.Expression(result)
            self.read(")")
        result *= signo
        return result


    def Number(self, result):
        self.read('number', True)
        result = int(self.last_token.value)
        return result


class Token:
    def __init__(self, type, value):
        self.type = type
        self.value = value


def matching(automata, texto):
    opts = list(texto)
    r=0
    while r< len(opts):
        if opts[r] == " " or opts[r] == "":
            opts[r] = utils.EPSILON
        r+=1
    est = [0]
    est = utils.cerraduraEpsilon(automata, est)
    q = 0
    while True:
        temporales = []
        for es in est:
            for trans in automata.states[es].transitions:
                if trans.simbolo == opts[q] and trans.destino not in temporales:
                    temporales.append(trans.destino)
        q += 1
        temporales = utils.cerraduraEpsilon(automata, temporales)
        if not temporales and opts == utils.EPSILON:
            break
        est = temporales.copy()
        if q > len(opts) - 1:
            break
    for x in est:
        if automata.states[x].accept:
            return True
    return False


def longest_string(file, automata, current=0):
    temp = ''
    valid = []
    while current < len(file):
        temp += file[current]
        if matching(automata, temp):
            valid.append(temp)
        elif len(temp) == 1 and matching(automata, str(ord(temp))):
            valid.append(temp)
        current += 1
    if valid:
        return max(valid, key=len)
    return False


